INSERT INTO dyn_element_config (UI_REFERENCE_ID,DESCRIPTION,SUB_SECTION_CODE,SECTION_CODE,HELP,INSTRUCTION,UPDATE_USER,UPDATE_TIMESTAMP) VALUES ('prop-bdgt-l-itm-desc','Proposal Budget Detailed budget Line Item Description','310','DP303','Please add a brief description to each line item. Examples: Post-doc fellow 1 for tasks 1-4; Travel to conference [insert name]; Flights for research visitor [insert name]; Sub-award to [insert university name];  Laboratory consumables for tasks 1-4; Technical service contract with [clinic name] for tasks 5-6; Field work costs for sample collection [tasks 3-4]; etc. ',NULL,'admin','2025-03-21 13:36:29');
