INSERT INTO dyn_element_config (UI_REFERENCE_ID,DESCRIPTION,SUB_SECTION_CODE,SECTION_CODE,HELP,INSTRUCTION,UPDATE_USER,UPDATE_TIMESTAMP) VALUES ('PROPOSAL_BDGT_TTL_REQ_COST','Proposal Budget Total Requested Cost','343','DP303','The total sum of Direct Costs that will be borne by the project budget.',NULL,'admin','2025-03-21 13:36:30');
INSERT INTO dyn_element_config (UI_REFERENCE_ID,DESCRIPTION,SUB_SECTION_CODE,SECTION_CODE,HELP,INSTRUCTION,UPDATE_USER,UPDATE_TIMESTAMP) VALUES ('PROPOSAL_BDGT_TTL_IN_KIND','Proposal Budget Total In Kind','343','DP303','In-Kind is the contribution of goods or services other than money. For KU budgeting purposes, in-kind shall be any cost that contributes to the delivery of the project, but not charged to the project, such as faculty time, graduate students and internal overhead. The value of such-in-kind contributions is captured as applicable in the budget and narrative to comprehensively demonstrate the resources dedicated to the project.',NULL,'admin','2025-03-21 13:36:30');
INSERT INTO dyn_element_config (UI_REFERENCE_ID,DESCRIPTION,SUB_SECTION_CODE,SECTION_CODE,HELP,INSTRUCTION,UPDATE_USER,UPDATE_TIMESTAMP) VALUES ('PROPOSAL_BDGT_TTL_COST','Proposal Budget Total Cost','343','DP303','The total sum of Direct Costs and In-Kind Costs.',NULL,'admin','2025-03-21 13:36:30');
INSERT INTO dyn_element_config (UI_REFERENCE_ID,DESCRIPTION,SUB_SECTION_CODE,SECTION_CODE,HELP,INSTRUCTION,UPDATE_USER,UPDATE_TIMESTAMP) VALUES ('PROPOSAL_BDGT_DBDGT_C_ELEMNT','Proposal Budget Detailed budget Cost Share','310','DP303','Please select the cost element line items in order of the following categories as required: 1. Faculty, 2. Students, 3. Research Staff, 4. Direct Costs (Operational Expenses, Other Direct Costs, Sub-Contracts, Technical Consulting, Travel).',NULL,'admin','2025-03-21 13:36:30');
INSERT INTO dyn_element_config (UI_REFERENCE_ID,DESCRIPTION,SUB_SECTION_CODE,SECTION_CODE,HELP,INSTRUCTION,UPDATE_USER,UPDATE_TIMESTAMP) VALUES ('PROPOSAL_BDGT_DBDGT_L_ITM_DESC','Proposal Budget Detailed budget Line Item Description','310','DP303','Please add a brief description to each line item. Examples: Post-doc fellow 1 for tasks 1-4; Travel to conference [insert name]; Flights for research visitor [insert name]; Sub-award to [insert university name];  Laboratory consumables for tasks 1-4; Technical service contract with [clinic name] for tasks 5-6; Field work costs for sample collection [tasks 3-4]; etc. ',NULL,'admin','2025-03-21 13:36:30');
INSERT INTO dyn_element_config (UI_REFERENCE_ID,DESCRIPTION,SUB_SECTION_CODE,SECTION_CODE,HELP,INSTRUCTION,UPDATE_USER,UPDATE_TIMESTAMP) VALUES ('PROPOSAL_BDGT_DBDGT_COST_SHARE','Proposal Budget Detailed budget Line Item Description','310','DP303','MANDATORY to enter % in-kind for calculation purposes. Typical % in-kind values are: Research Staff (0%), Graduate Students (100%), Faculty (100%)',NULL,'admin','2025-03-21 13:36:30');
INSERT INTO dyn_element_config (UI_REFERENCE_ID,DESCRIPTION,SUB_SECTION_CODE,SECTION_CODE,HELP,INSTRUCTION,UPDATE_USER,UPDATE_TIMESTAMP) VALUES ('PROPOSAL_BDGT_DBDGT_EFFORT_%','Proposal Budget Detailed budget Effort','310','DP303','MANDATORY to enter % of Effort, percentate of time expected to spend on the project, whilst taking into account other duties such as teaching, research and management. Typical % of Effort values are: Faculty (up to 15% or as specified in grant call), Research Staff (100%), and, Graduate Students (100%). ',NULL,'admin','2025-03-21 13:36:30');
